import React from "react";
import { Menu } from "semantic-ui-react";

export default function campaings() {
    const colors = [
       
        'grey',
      ]
  return (
    <div>
      <Menu widths={3} color={colors}  inverted size="large">
        <Menu.Item name="home" />
        <Menu.Item name="messages" />
        <Menu.Item name="friends" />
      </Menu>
    </div>
  );
}
